export default function Worker() {
    return (
        <>
            <h1>worker</h1>
            <form>
                <h2>הקש כתובת מייל</h2>
                <input type="email" name="email" />
                <h2>הקש סיסמא</h2>
                <input type="password" name="password" />
            </form>
        </>
    );
}
